  const myFunc = (x,y)=> x+y;
  return (
    <div className="App">
     {/* <RoutePages/> */}
     <userContext.Provider value = {{asd,setAsd,myFunc}}><RoutePages/></userContext.Provider>
    </div>
  );
}

